<h3>insignitus</h3>
<strong>I</strong>
 īnsīgnītus, a, um
<div><strong>1.</strong>
<em>part. pf. к</em> insignio </div>
<strong>2.</strong> adj.
<div>1) заметный, ясный, отчётливый, явственный (<em>nota veritatis, imago C</em>)</div>
<div>2) замечательный, необыкновенный (<em>forma rhH.</em>)</div>
<div>3) неслыханный (<em>injuria Cato</em>)</div>
<strong>II</strong> īn-sīgnītus, a, um <em>adj.</em> [ signum ]
<div>снабжённый знаменем <em>Enn</em></div>
